import React, { useEffect } from "react";
import { Provider } from "react-redux";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import store from "./store";
import setAuthToken from "./utill/setAuthToken";
import { setCurrentUser } from "./actions/authAction";
import Dashboard from "./components/dashboard/index";
import Home from "./components/dashboard/components/Home";
import Register from "./components/auth/Register";
import Login from "./components/auth/Login";
import Landing from "./components/landing";
import Producted from "./reducers/productReducers"; 
import Addproduct from "./components/dashboard/components/Addproduct";
import "./App.css";

// Set the authentication token if available in localStorage
if (localStorage.token) {
  setAuthToken(localStorage.token);
}

function App() {
  useEffect(() => {
    // Dispatch action to set current user if token is present
    store.dispatch(setCurrentUser());
  }, []);

  return (
    <Provider store={store}>
      <Router>
        <div className="App">
          <Route path="/" element={<Landing />} />
          <Routes>
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<Login />} />
            <Route path="/dashboard/*" element={<ProtectedRoute />}>
              <Route index element={<Dashboard />}>
                <Route index element={<Home />} />
                <Route path="addProduct" element={<Addproduct />} />
              </Route>
            </Route>
          </Routes>
        </div>
      </Router>
    </Provider>
  );
}

export default App;
